import React from 'react';
import logo from './logo.svg';
import './App.css';
import Favicon from './Favicon';
import Plant from './Plant';

function App() {
  return (

      <div className="App">
        <head>
          <Favicon />
        </head>
        <body>
        <link href="data:image/x-icon;base64," rel="icon" type="image/x-icon" />
         <div class="row">
            <div class="column">
              <Plant />
              <Plant />
              <Plant />
            </div>
          </div>
        </body>  
    </div>
  );
}

export default App;
